  const getSubTitleWithTooltip = () => {
    return <>
        Click <span>here</span> to upload your data
        <Tooltip label="Facts and statistics collected together for reference or analysis">
          <Information size="16" />
        </Tooltip>
      </>;
  };
  const getAction = (icon = undefined) => {
    const actionObj = {
      text: 'Create new',
      onClick: () => {
        sbDocs ? storybookAction('Clicked empty state action button')() : console.log('Clicked empty state action button');
      }
    };
    if (icon) {
      return {
        ...actionObj,
        renderIcon: props => <Add size={20} {...props} />,
        iconDescription: 'Add icon'
      };
    }
    return actionObj;
  };
  return <EmptyState {...args} subtitle={subtitle === 'default' ? getSubTitle() : getSubTitleWithTooltip()} action={typeof action === 'boolean' && getAction(action)} />;
